import React from 'react';
import logo from './images/logo.png';

const Header= () => {
  return (
    <>
      <div>
       <div> <h1>Welcome hii </h1></div>
        <img src={logo} alt ="flogo"/>
      </div>
    </>
  );
}

export default Header;
